import React from "react";
import Header from "./components/Header";

import { BrowserRouter, Route } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <Header />
        <Route path="/" exact component={Header}></Route>
      </BrowserRouter>
    );
  }
}

export default App;
